import React, { Component } from "react";
    
import Upload from "./imageUpload";
import Usage from "./usage";


export default class Child extends Component {
    render(){
        return(
            <div>
                <div className="row">
                    <div className="col-md-12"></div>
                       <Upload/>
                        <Usage/>
                </div>
            </div>
        )  
    }
}
